import styled from "styled-components";
import {Theme} from "../Thems.styled";


export const Header = styled.div`
  color: ${Theme.colors.primary};
  font-size: 16px;
  font-family: Inter;
  font-style: normal;
  font-weight: 700;
  line-height: normal;
`
